import React, { useState } from "react";
import { Link, useParams, useNavigate, useLocation } from "react-router-dom";
import "./PetshopPage.css";
import petshop from "../assets/images/Petshop/petshop.png";

const DogRunPage: React.FC = () => {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/DogrunRegionsList');
  };
  return (
    <div style={{ textAlign: 'center', marginTop: '20px' }}>
    <h1>wan paradise</h1>
    <p onClick={handleClick} style={{ cursor: 'pointer', fontSize: '18px' }}>
      全国のドッグランを探す
    </p>
    <div>
      <img src={DogrunImage} alt="ドッグランのイラスト" style={{ width: '200px' }} />
    </div>
  </div>
  );
};



export default PetshopPage;
